import SHOP_DATA from './ShopData';

export class ShopPage extends Component {
    constructor(props) {
        super(props)
    
        this.state = {
             collections: SHOP_DATA
        }
    }
    
    render() {
        return (
            <div>
                Shop page
            </div>
        )
    }
}

export default ShopPage
